	add("magdalene", "{\"term\":\"magdalene\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"Byname of the biblical Mary Magdalene, \u0026quot;Mary of Magdala\u0026quot;, from the name of a village on Lake Galilee from Hebrew \u0027מגדל\u0027 (tower) Generic use comes from the traditional association of Mary Magdalene with the \u0026quot;woman which was a sinner\u0026quot; mentioned in Luke 7:37.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mary Magdalene, a disciple of Jesus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And the twelve were with him; and certain woman which had been healed of evil spirits, Mary called \u0027\u0027Magdalene\u0027\u0027, out of whom went seven devils\", \"priority\":2}]}, \"synonyms\":{}}");

	add("magenta", "{\"term\":\"magenta\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Named in 1859 by Edward Chambers Nicholson after the w:Battle of Magenta|Battle of Magenta, fought earlier that year in {{w|Magenta, Lombardy}}. The town\u0027s name is from Latin \u0027castrum\u0027 \u0027maxentiae\u0027 \u0026quot;castle of \u0027maxentius\u0027 \u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A light purple, purplish-red, or pinkish purple colour obtained by mixing red and blue light (thus a secondary colour), but primary in the CMYK colour system used in printing\", \"priority\":1}]}, \"synonyms\":{}}");

