	add("maggie", "{\"term\":\"maggie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027 w:David David Leavitt, \u0027The Lost Language of Cranes\u0027, Houghton Mifflin (1997), ISBN 0395877334, page 127\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Maggie\u0027\u0027. Never in her life had she heard her mother called \u0027\u0027Maggie\u0027\u0027. It was a name from her youth, that dead time Jerene had never been allowed to talk about [- - -]. Her mother was Margaret now\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 w:Joanne Joanne Harris, \u0027Jigs \u0026amp; Reels\u0027, Doubleday, ISBN 0385606427, page 81\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I could tell that some of the guests were confused by the name of \u0027\u0027Maggie\u0027\u0027―no-one had called her by that clunky, unfashionable name in years\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"w:Margaret Margaret Thatcher, former British prime minister\", \"priority\":5}]}, \"synonyms\":{}}");

	add("maggot", "{\"term\":\"maggot\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027magot\u0027 \u0027magotte\u0027 probably Anglo-norman alteration of \u0027maddock|lang\u003denm\u0027 () originally a diminutive form of a base represented by Old English maþa (Scots mathe), from common Proto-germanic root \u0027*mathon-\u0027, from the Proto-indo-european root \u0027*math-\u0027, which was used in insect names, equivalent to {{suffix|made|ock|lang\u003den|nocat\u003d1}}. Near-cognates include Dutch made, German Made and Swedish mask. \u0026lt;!-- explained in Brewer\u0027s Dictionary of Phrase and Fable, Centenary edition, second impression, 1971, SBN 304-93570-0. --\u0026gt; The use of \u0027maggot\u0027 to mean a fanciful or whimsical thing derives from the folk belief that a whimsical or crotchety person had maggots in his or her brain.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soft, legless larva of a fly or other dipterous insect, that often eats decomposing organic matter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A worthless person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Drop and give me fifty, \u0027\u0027maggot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A whimsy or fancy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Mr. Beveridge\u0027s \u0027\u0027Maggot\u0027\u0027\u0027, an old country dance [http://www.izaak.unh.edu/nhltmd/indexes/dancingmaster/Dance/Play4199.htm\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1620\u0027\u0027, w:John Fletcher John Fletcher, \u0027Women Pleased\u0027, III.iv\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Are you not mad, my friend? What time o\u0027 th\u0027 moon is\u0027t? / Have not you \u0027\u0027maggots\u0027\u0027 in your brain\", \"priority\":7}]}, \"synonyms\":{}}");

	add("maghemite", "{\"term\":\"maghemite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"After the beginnings of \u0027magnetite\u0027 and \u0027hematite\u0027 in 1927, because of magnetism and similar arrangement of elements.\u0026lt;ref name\u003d\u0026quot;New Dana\u0026quot;\u0026gt;Richard V. Gaines, H. Catherine W. Skinner, Eugene E. Foord, Brian Mason, and Abraham Rosenzweig: \u0026quot;Dana\u0027s new mineralogy\u0026quot;, pp. 229-230. John Wiley \u0026amp; Sons, 1997\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A magnetic mineral with a grey blue, white, or brown shade.\u0026lt;ref name\u003d\u0026quot;New Dana\u0026quot;/\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

