	add("magic", "{\"term\":\"magic\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027magique\u0027 (noun and adjective), from Latin \u0027\u0027 (adjective), \u0027magica\u0027 (noun use of feminine form of \u0027\u0027 , from Ancient greek (to 1453) \u0027μαγικός\u0027 (magical) from \u0027μάγος\u0027 (magus) Displaced native Middle english (1100-1500) \u0027dweomercraft\u0027 (magic, magic arts) (from Old english (ca. 450-1100) \u0027dwimor\u0027 (phantom, illusion) + \u0027cræft\u0027 (art) , Old english (ca. 450-1100) \u0027galdorcræft\u0027 (magic, enchantment) Old english (ca. 450-1100) {{m|ang|drȳcræft||magic, sorcery}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of rituals or actions, especially based on supernatural or occult knowledge, to manipulate or obtain information about the natural world, especially when seen as falling outside the realm of religion; also the forces allegedly drawn on for such practices\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c. 1489\u0027\u0027, \u0027Foure Sonnes of Aymon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And whan he shall be arrayed as I telle you / lete hym thenne doo his incantacyons \u0026amp; his \u0027\u0027magyke\u0027\u0027 as he wyll […\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1781\u0027\u0027, \u0027Decline and Fall of the Roman Empire\u0027, II.23\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The arts of \u0027\u0027magic\u0027\u0027 and divination were strictly prohibited\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society 2012, p. 23\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Conversions to the new religion […] have frequently been assisted by the view of converts that they are acquiring not just a means of otherworldly salvation, but a new and more powerful \u0027\u0027magic\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A specific ritual or procedure associated with supernatural magic or with mysticism; a spell\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Something producing remarkable results, especially when not fully understood; an enchanting quality; exceptional skill\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe original family who had begun to build a palace to rival Nonesuch had died out before they had put up little more than the gateway, so that the actual structure which had come down to posterity retained the secret \u0027\u0027magic\u0027\u0027 of a promise rather than the overpowering splendour of a great architectural achievement\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A conjuring trick or illusion performed to give the appearance of supernatural phenomena or powers\", \"priority\":11}]}, \"synonyms\":{}}");

	add("magician", "{\"term\":\"magician\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027magicien\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who plays with or practices allegedly supernatural magic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A spiritualist or practitioner of mystic arts\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/books-and-arts/21604535-real-sir-isaac-newton-was-not-first-king-reason-last Magician’s passage\u003dThe truth is that [Isaac] Newton was very much a product of his time. The colossus of science was not the first king of reason, Keynes wrote after reading Newton’s unpublished manuscripts. Instead “he was the last of the \u0027\u0027magicians\u0027\u0027”\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A performer of tricks or an escapologist\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An amazingly talented craftsman or scientist\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person who astounds, is an enigma\", \"priority\":6}]}, \"synonyms\":{}}");

