	add("magpie", "{\"term\":\"magpie\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Mag, a nickname for Margaret that was used to denote a chatterer, and pi. Etymology_2|pie, an archaic word meaning \u0026quot;magpie\u0026quot;, from Old french (842-ca. 1400) {{m|fro|pie}}, from Latin {{m|la|pica}}, from Proto-indo-european {{m|ine-pro|*(s)peyk-||woodpecker, magpie}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of several kinds of bird in the family Corvida\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"especially \u0027Pica pica\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A superficially similar Australian bird, now\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Someone who displays a magpie-like quality such as collecting, or committing robbery\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Fan or member of\", \"priority\":5}]}, \"synonyms\":{}}");

	add("magus", "{\"term\":\"magus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027magus\u0027 from Ancient greek (to 1453) \u0027μάγος\u0027 (magician) from \u0027μάγος\u0027 (magian) of an indeterminate origin (see Μάγος for details)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"common usage) magician, and derogatorily sorcerer, trickster, conjurer, charlata\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"special usage) a Zoroastrian priest: \u0027\u0027Note\u0027\u0027: the two meanings overlap in classical usage\u0026amp;mdash; both derive from the Greco-Roman identification of \u0026quot;Zoroaster\u0026quot; as the \u0026quot;inventor\u0026quot; of astrology and magic. The first meaning (\u0027magician\u0027) derives from the sense of \u0026quot;practitioner of the Zoroaster\u0027s craft\u0026quot;, and the second meaning (\u0027priest\u0027) from the sense of \u0026quot;practitioner of Zoroaster\u0027s religion\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

